import { Card, Container } from '@material-ui/core';
import React, { useState } from 'react';
import Page from '../Page';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';
import Summoner from './Summoner';
import Summoner2 from './Summoner2';

import Summoner5 from './Summoner5';
import { API_KEY } from './const';

  const players = ["Anxhanna"];



export default class Home extends React.Component {

    constructor(props) {
        super(props);
        this.state= {
            name: "",
            post: {},
            summoner_infos: [{},{}],
            summoner_id: '',
            summoner_account_id: '',
            status: 0,
            error_message: null,
            body: null,
            icon_url: '',
        };


    }


    render() {

        const { name, summoner_infos, icon_url, error_message, body } = this.state;
    return (
        <Page title="Ranking">
                <Container>
                    <TableContainer component={Paper} >
        <aside>
       <Table sx={{ minWidth: 650 ,bgcolor: '#2F4F4F'}} aria-label="simple table">
        <TableHead>
          <TableRow >
            <TableCell sx={{ color: 'white'}}>Player</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Summoner Name</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">Rank</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">W</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">L</TableCell>
            <TableCell sx={{ color: 'white'}} align="right">LP</TableCell>
          </TableRow>
        </TableHead>
        <TableBody>
            <TableRow
              sx={{ 'td, th': { border: 0, color: 'white' } }}
            >
              <TableCell component="th" scope="row">Alvyn</TableCell>

              <TableCell align="right">{players[0]}</TableCell>
              <TableCell align="right">{ summoner_infos[1] ? summoner_infos[1].tier : null } { summoner_infos[1] ? summoner_infos[1].rank : null }</TableCell>
              <TableCell align="right">{ (summoner_infos[1] && summoner_infos[1].leaguePoints) ? <p>{summoner_infos[1].leaguePoints } lp</p> : null }{(summoner_infos[1] && summoner_infos[1].wins) ? summoner_infos[1].wins : null}</TableCell>
              <TableCell align="right">{(summoner_infos[1] && summoner_infos[1].losses) ? summoner_infos[1].losses : null}</TableCell>   
              <TableCell align="right">{summoner_infos[1].leaguePoints}</TableCell>

            </TableRow>
            <Summoner></Summoner>   
            <Summoner2></Summoner2>
            <Summoner5></Summoner5> 
        </TableBody>
      </Table>
      </aside>
    </TableContainer>

                </Container>
        </Page>
    )
}
}
